ERROR - 2021-10-12 20:39:03 --> Query error: Unknown column 'about_condition' in 'field list' - Invalid query: INSERT INTO `kcms_askgogo_ranking` (`about_condition`, `active`, `advice_to_patient`, `condition`, `condition_description`, `condition_rationale`, `create_date`, `deleted`, `exceptions`, `id`) VALUES ('There is little evidence to suggest that treatments such as lozenges or throat sprays help to treat the cause of sore throat. ','Yes','Patient action:\n1. Extremely common and likely to get better in 3-7 days and a maximum of 2 weeks.\n2. Most last for an average of 8 days. You will not need antibiotics for most throat infections.\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines\n4. Take simple painkillers and implement some self care measures such as gargling with warm salty water instead. ','Acute sore throat','Self limiting condition','A sore throat due to a viral or bacterial cause is a self-limiting condition. Symptoms resolve within 3 days in 40% of people, and within 1 week in 85% of people, irrespective of whether or not the sore throat is due to a streptococcal infection.\n\nThere is little evidence to suggest that treatments such as lozenges or throat sprays help to treat the cause of sore throat and patients should be advised to take simple painkillers and implement some self-care measures such as gargling with warm salty water instead.','2021-10-12 20:39:03','No','1. Drooling/difficult to swallow - urgent!\n2. Persistent high temp over 38 degrees for more than 3 days that doesn’t come down with paracetamol or ibuprofen\n3. Symptoms last longer than 10-14 days\n4. Hard to breathe/drink fluids','1'), ('Cold sores caused by the herpes simplex virus usually clear up without treatment within seven to ten days ','Yes','Antiviral creams are available OTC from pharmacies without a prescription. If used correctly, they can help ease symptoms and speed up the healing time. \n\nTo be effective, apply as soon as the first signs of a cold sore appear.\n\nUsing an antiviral cream after this initial period is unlikely to have much of an effect. ','Infrequent cold sores of the lip','Self limiting condition','Cold sores caused by the herpes simplex virus usually clear up without treatment within 7 to 10 days. Antiviral creams are available over the counter from pharmacies without a prescription and if used correctly, these can help ease symptoms and speed up the healing time. To be effective, these treatments should be applied as soon as the first signs of a cold sore appear. Using an antiviral cream after this initial period is unlikely to have much of an effect.','2021-10-12 20:39:03','No','1. Immunocompromised patients\n2. Red flag symptoms ','2'), ('1. Most colds start to improve in 7-10 days.\n2. Most coughs clear up within 2-3 weeks.\n3. Both conditions can cause nasal congestion.\n4. Neither condition requires any treatment.\n5. However, some over the counter medicines help to relieve short term fevers and nasal congestion. ','Yes','These conditions do not require any treatment. However, some over the counter medicines help to relieve short term fevers and nasal congestion. ','Coughs, colds, nasal congestion','Self limiting condition','Most colds start to improve in 7 to 10 days. Most coughs clear up within two to three weeks. Both conditions can cause nasal congestion. Neither condition requires any treatment.','2021-10-12 20:39:03','No','1. Temp above 39 degrees\n2. Confusion/disorientation\n3. Sharp chest pain\n4. Symptoms have lasted longer than 3 weeks\n5. Coughing up blood','3'), ('Treatment is not usually needed for conjunctivitis as the symptoms usually clear within a week. There are several self care measures that may help with symptoms. If treatment is needed, then treatment is dependent on the cause: \n1. In severe bacterial cases, antibiotic eye drops and eye ointments can be used to clear the infection.\n2. Irritant conjunctivitis will clear up as soon as whatever is causing it is removed.\n3. Allergic conjunctivitis can usually be treated with antiallergy medications such as antihistamines. The substance that caused the allergy should be avoided.','Yes','Treatments for conjunctivitis can be purchased over the counter however almost half of all simple cases of conjunctivitis clear up within ten days without any treatment. ','Conjunctivitis','Self limiting condition','Treatment isn’t usually needed for conjunctivitis as the symptoms usually clear within a week. There are several self-care measures that may help with symptoms. If treatment is needed, then treatment is dependent on the cause:\n1. In severe bacterial cases, antibiotic eye drops and eye ointments can be used to clear the infection.\n2. Irritant conjunctivitis will clear up as soon as whatever is causing it is removed.\n3. Allergic conjunctivitis can usually be treated with antiallergy medications such as antihistamines. The substance that caused the allergy should be avoided.\n\nTreatments for conjunctivitis can be purchased over the counter however almost half of all simple cases of conjunctivitis clear up within ten days without any treatment. Doctors advise that children with infective conjunctivitis do not need to be excluded from school, nursery or child minders, and do not state any requirement for treatment with topical antibiotics.','2021-10-12 20:39:03','No','1. Loss of vision/sensitive to light ','4'), ('1. Cradle cap is harmless and does not usually itch or cause discomfort.\n2. It usually appears in babies in the first two months of their lives, and clears up without treatment within weeks to a few months. ','Yes','Cradle cap treatment should not routinely be offered in primary care as the condition is self-limiting and will clear up on its own without the need for treatment. ','Cradle cap','Self limiting condition','Cradle cap is harmless and doesn’t usually itch or cause discomfort. It usually appears in babies in the first two months of their lives, and clears up without treatment within weeks to a few months','2021-10-12 20:39:03','No','If causing distress to the infant and not improving ','6'), ('1. Diarrhoea normally affects most people from time to time and is usually nothing to worry about. However, it can take a 3-7 days to clear up. \n2. Acute diarrhoea is usually caused by a bacterial or viral infection and other causes include drugs, anxiety or a food allergy. ','Yes','Symptoms can last up to one week. Patient Action:\n1. Drink fluids\n2. Speak to your local pharmacist about Over the Counter (OTC) medicines that can help replace lost fluids or reduce bowel motions.','Diarrhoea (adults only) ','Minor illness suitable for self care','Diarrhoea normally affects most people from time to time and is usually nothing to worry about. However it can take a few days to a week to clear up. Acute diarrhoea is usually caused by a bacterial or viral infection and other causes include drugs, anxiety or a food allergy. OTC treatments can help replace lost fluids or reduce bowel motions. This recommendation does not apply to children.','2021-10-12 20:39:03','No','1. Still dehydrated despite using rehydration sachets\n2. Bloody stools/bleeding bottom\n3. Diarrhoea for 7 days + or vomiting for 2 days + \n\nPlease note: THIS RECOMMENDATION DOES NOT APPLY TO CHILDREN','12'), ('Most people have indigestion at some point. Usually, it is not a sign of anything more serious and can be treated at home without the need for medical advice, as it is often mild and infrequent and specialist treatment is not required. ','Yes','Patient Action:\n1. Most people can manage their indigestion by making simple diet and lifestyle changes, or taking medicine such as antacids. \n2. Most people can ease symptoms by simple changes to diet and lifestyle and avoiding foods that make indigestion worse (e.g. rich spicy or fatty foods, caffeinated drinks).\n2. Speak to your local pharmacist about Over the Counter (OTC) medicines','Indigestion and heartburn','Minor illness suitable for self care','Most people have indigestion at some point. Usually, it’s not a sign of anything more serious and can be treated at home without the need for medical advice, as it\'s often mild and infrequent and specialist treatment isn\'t required. Most people are able to manage their indigestion by making simple diet and lifestyle changes, or taking medication such as antacids. Most people can ease symptoms by simple changes to diet and lifestyle and avoiding foods that make indigestion worse. (e.g. rich spicy or fatty foods, caffeinated drinks).','2021-10-12 20:39:03','No','1. Vomiting blood or dark lumps (coffee grounds)\n2. Swallowing problems\n3. Unexplained fever/night sweats/weight loss/swelling in abdomen','15'), ('Earwax is produced inside ears to keep them clean and free of germs. It usually passes out of the ears harmlessly, but sometimes too much can build up and block the ears. ','Yes','A build-up of earwax is a common problem that can often be treated using eardrops bought over the counter. These can help soften the earwax so that it falls out naturally. ','Earwax','Minor illness suitable for self care','Earwax is produced inside ears to keep them clean and free of germs. It usually passes out of the ears harmlessly, but sometimes too much can build up and block the ears. A build-up of earwax is a common problem that can often be treated using eardrops bought from a pharmacy. These can help soften the earwax so that it falls out naturally.','2021-10-12 20:39:03','No','Perforated ear drum ','16'), ('Headlice are a common problem, particularly in school children aged 4-11. They are largely harmless, but can live in the hair for a long time if not treated and can be irritating and frustrating to deal with. ','Yes','1. It is not always possible to prevent head lice infestation, as they are spread by close head to head contact, especially when children are playing. However, these self care tips will help with detection and prevention.\n2. Frequent checking - carefully looking at your child’s scalp and hair for head lice, especially at the start of the school year. Ideally do this weekly.\n3. ‘Wet combing’- Wash hair as usual then use conditioner, do not wash this off. Use a normal comb to untangle hair, then a fine-toothed head lice detection comb to remove live head lice.\n4. Avoid sharing - Hats, combs, hairbrushes, towels, pillows.\n5. Hair length - People with longer hair are more likely to catch head lice, simply because it is easier for the head lice to transfer to and from longer hair.\n6. Head lice eradication products containing alcohol: there is a risk of serious burns if treated hair is exposed to open flames or other sources of ignition, e.g. cigarettes.','Headlice','Minor illness suitable for self care','Head lice are a common problem, particularly in school children aged 4-11. They\'re largely harmless, but can live in the hair for a long time if not treated and can be irritating and frustrating to deal with. Live head lice can be treated by wet combing; chemical treatment OFFICIAL 25 is only recommended in exceptional circumstances and in these cases over the counter medicines can be purchased from a pharmacy. If appropriate everyone in the household needs to be treated at the same time - even if they don\'t have symptoms. Further information on how to treat head lice without medication can be found on NHS Choices.','2021-10-12 20:39:03','No','1. Current skin conditions of the scalp\n2. Side effects of a severe infestation','18'), ('Constipation can affect people of all ages and can be just for a short period of time. ','Yes','It can be effectively managed with a change in diet or lifestyle and short term use of over the counter laxatives. ','Infrequent constipation','Minor illness suitable for self care','Constipation can affect people of all ages and can be just for a short period of time. It can be effectively managed with a change in diet or lifestyle. Pharmacists can help if diet and lifestyle changes aren\'t helping. OFFICIAL 26 They can suggest an over the counter laxative. Most laxatives work within 3 days. They should only be used for a short time only. Laxatives are not recommended for children unless they are prescribed by a GP. This guidance applies to short term, infrequent constipation caused by changes in lifestyle or diet such as lack of water or movement or changes in diet.','2021-10-12 20:39:03','No','1. Symptoms have lasted longer than 6 weeks\n2. Swollen stomach\n3. Vomiting\n4. Feverish\n5. Feeling unwell\n6. Bloods in stools\n7. Weight loss','20'), ('Migraine is a common health condition, affecting around one in every five women and around one in every 15 men. ','Yes','Patient Action:\n1. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms\n2. Mild infrequent headaches and migraines can be adequately treated with over the counter painkillers, and a number of combination medicines for migraine are available that contain both painkillers and anti-sickness medicines.\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines','Infrequent headaches and migraine','Minor illness suitable for self care','Migraine is a common health condition, affecting around one in every five women and around one in every 15 men. Mild infrequent migraines can be adequately treated with over the counter pain killers and a number of combination medicines for migraine are available that contain both painkillers and antisickness medicines. Those with severe or recurrent migraines should continue to seek advice from their GP.','2021-10-12 20:39:03','No','1. Stiff neck\n2. Drowsy\n3. Vomiting\n4. Change in speech/personality\n5. Odd sensations/numbness/weakness\n6. Sudden/severe headache \n7. Photophobia/blind spots','21'), ('Most people prevent symptoms of sun damage developing using sun protection. These products can easily be bought in a pharmacy or supermarket. ','Yes','Sun protection products can readily be bought in a pharmacy or supermarket. ','Sun protection ','Minor illness suitable for self care','Most people manage sun burn symptoms themselves or prevent symptoms developing, using sun protection, by using products that can easily be bought in a pharmacy or supermarket.','2021-10-12 20:39:03','No','Advisory Committee on Borderline Substances (ACBS) approved indication of photodermatoses, i.e. where skin protection should be prescribed. ','24'), ('Hay fever is a common allergic condition that affects up to 1 in 5 people. ','Yes','Patient Action:\n1. There is currently no cure for hay fever, but most people with mild to moderate symptoms are able to relieve symptoms at home\n2. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines','Hay fever/allergic rhinitis','Minor illness suitable for self care','Hay fever is a common allergic condition that affects up to one in five people. There\'s currently no cure for hay fever, but most people with mild to moderate symptoms are able to relieve symptoms with OTC treatments recommended by a pharmacist.','2021-10-12 20:39:03','No','Appointment with practice pharmacist if:\n1. Wheezing/breathless/tight chest\n2. Pregnant/breastfeeding\n3. Symptoms not relieved with OTC medication\n\nTriage if: \n1. Photophobia\n2. Ear pain\n3. Severe coughing/swollen lymph glands','25'), ('Burns and scalds are damage to the skin caused by heat. Both are treated in the same way. Depending on how serious a burn is, it is possible to treat burns at home. ','Yes','Patient Action:\n1. Antiseptic creams and treatments for burns should be kept in a medicine cabinet at home.\n2. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms.\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines.','Minor burns and scalds','Minor illness suitable for self care','Burns and scalds are damage to the skin caused by heat. Both are treated in the same way. Depending on how serious a burn is, it is possible to treat burns at home. Antiseptic creams and treatments for burns should be included in any products kept in a medicine cabinet at home.','2021-10-12 20:39:03','No','Serious burns always require professional medical attention. Burns requiring hospital emergency treatment include but are not limited to:\n1. Chemical/electrical burns\n2. Large/deep burns (larger than hand-size)\n3. White/charred skin\n4. Burns of face/hands/arms/feet/legs/genitals and cause blisters\n5. DO NOT SEE GP IF BURNS ARE SEVERE - SEE MINOR INJURY UNIT OR GO TO HOSPITAL','26'), ('Ringworm is a common fungal infection that can cause a red or silvery ring-like rash on the skin. Despite its name, ringworm doesn’t have anything to do with worms. \n\nAthlete’s foot is a rash caused by a fungus that usually appears between the toes. ','Yes','1. These fungal infections, medically known as “tinea”, are not serious and are usually easily treated with over the counter treatments.\n2. However, they are contagious and easily spread so it is important to practice good foot hygiene. ','Ringworm/athletes foot','Minor illness suitable for self care','Ringworm is a common fungal infection that can cause a red or silvery ring-like rash on the skin. Despite its name, ringworm doesn\'t have anything to do with worms. Athlete\'s foot is a rash caused by a fungus that usually appears between the toes. These fungal infections, medically known as \"tinea\", are not serious and are usually easily treated with over the counter treatments. However, they are contagious and easily spread so it is important to practice good foot hygiene.','2021-10-12 20:39:03','No','Lymphoedema or history of lower limb cellulitis. ','32'), ('Threadworms (pinworms) are tiny worms that pass in the stools. They are common in children and can be spread easily. They can be effectively treated without the need to visit the GP. ','Yes','Patient Action:\n1. Treatment for threadworms can easily be bought from pharmacies. This is usually a chewable tablet or liquid formulation.\n2. Strict hygiene measures can also help clear up a threadworm infection and reduce the likelihood of reinfection.\n3. Everyone in the household will require treatment, even if they do not have symptoms. \"','Threadworms','Minor illness suitable for self care','Threadworms (pinworms) are tiny worms in your stools. They are common in children and can be spread easily. They can be effectively treated without the need to visit the GP. Treatment for threadworms can easily be bought from pharmacies. This is usually a chewable tablet or liquid you swallow. Strict hygiene measures can also help clear up a threadworm infection and reduce the likelihood of reinfection Everyone in the household will require treatment, even if they don’t have symptoms.','2021-10-12 20:39:03','No','Speak to GP if pregnant or breastfeeding or need to treat a child under the age of 2yrs. ','34')
