. Frequent checking - carefully looking at your child’s scalp and hair for head lice, especially at the start of the school year. Ideally do this weekly.\n3. ‘Wet combing’- Wash hair as usual then use conditioner, do not wash this off. Use a normal comb to untangle hair, then a fine-toothed head lice detection comb to remove live head lice.\n4. Avoid sharing - Hats, combs, hairbrushes, towels, pillows.\n5. Hair length - People with longer hair are more likely to catch head lice, simply because it is easier for the head lice to transfer to and from longer hair.\n6. Head lice eradication products containing alcohol: there is a risk of serious burns if treated hair is exposed to open flames or other sources of ignition, e.g. cigarettes.','Headlice','Minor illness suitable for self care','Head lice are a common problem, particularly in school children aged 4-11. They\'re largely harmless, but can live in the hair for a long time if not treated and can be irritating and frustrating to deal with. Live head lice can be treated by wet combing; chemical treatment OFFICIAL 25 is only recommended in exceptional circumstances and in these cases over the counter medicines can be purchased from a pharmacy. If appropriate everyone in the household needs to be treated at the same time - even if they don\'t have symptoms. Further information on how to treat head lice without medication can be found on NHS Choices.','2021-10-12 20:39:28','No','1. Current skin conditions of the scalp\n2. Side effects of a severe infestation','18'), ('Constipation can affect people of all ages and can be just for a short period of time. ','Yes','It can be effectively managed with a change in diet or lifestyle and short term use of over the counter laxatives. ','Infrequent constipation','Minor illness suitable for self care','Constipation can affect people of all ages and can be just for a short period of time. It can be effectively managed with a change in diet or lifestyle. Pharmacists can help if diet and lifestyle changes aren\'t helping. OFFICIAL 26 They can suggest an over the counter laxative. Most laxatives work within 3 days. They should only be used for a short time only. Laxatives are not recommended for children unless they are prescribed by a GP. This guidance applies to short term, infrequent constipation caused by changes in lifestyle or diet such as lack of water or movement or changes in diet.','2021-10-12 20:39:28','No','1. Symptoms have lasted longer than 6 weeks\n2. Swollen stomach\n3. Vomiting\n4. Feverish\n5. Feeling unwell\n6. Bloods in stools\n7. Weight loss','20'), ('Migraine is a common health condition, affecting around one in every five women and around one in every 15 men. ','Yes','Patient Action:\n1. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms\n2. Mild infrequent headaches and migraines can be adequately treated with over the counter painkillers, and a number of combination medicines for migraine are available that contain both painkillers and anti-sickness medicines.\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines','Infrequent headaches and migraine','Minor illness suitable for self care','Migraine is a common health condition, affecting around one in every five women and around one in every 15 men. Mild infrequent migraines can be adequately treated with over the counter pain killers and a number of combination medicines for migraine are available that contain both painkillers and antisickness medicines. Those with severe or recurrent migraines should continue to seek advice from their GP.','2021-10-12 20:39:28','No','1. Stiff neck\n2. Drowsy\n3. Vomiting\n4. Change in speech/personality\n5. Odd sensations/numbness/weakness\n6. Sudden/severe headache \n7. Photophobia/blind spots','21'), ('Most people prevent symptoms of sun damage developing using sun protection. These products can easily be bought in a pharmacy or supermarket. ','Yes','Sun protection products can readily be bought in a pharmacy or supermarket. ','Sun protection ','Minor illness suitable for self care','Most people manage sun burn symptoms themselves or prevent symptoms developing, using sun protection, by using products that can easily be bought in a pharmacy or supermarket.','2021-10-12 20:39:28','No','Advisory Committee on Borderline Substances (ACBS) approved indication of photodermatoses, i.e. where skin protection should be prescribed. ','24'), ('Hay fever is a common allergic condition that affects up to 1 in 5 people. ','Yes','Patient Action:\n1. There is currently no cure for hay fever, but most people with mild to moderate symptoms are able to relieve symptoms at home\n2. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines','Hay fever/allergic rhinitis','Minor illness suitable for self care','Hay fever is a common allergic condition that affects up to one in five people. There\'s currently no cure for hay fever, but most people with mild to moderate symptoms are able to relieve symptoms with OTC treatments recommended by a pharmacist.','2021-10-12 20:39:28','No','Appointment with practice pharmacist if:\n1. Wheezing/breathless/tight chest\n2. Pregnant/breastfeeding\n3. Symptoms not relieved with OTC medication\n\nTriage if: \n1. Photophobia\n2. Ear pain\n3. Severe coughing/swollen lymph glands','25'), ('Burns and scalds are damage to the skin caused by heat. Both are treated in the same way. Depending on how serious a burn is, it is possible to treat burns at home. ','Yes','Patient Action:\n1. Antiseptic creams and treatments for burns should be kept in a medicine cabinet at home.\n2. Check self care leaflet for advice on lifestyle changes to prevent/lessen symptoms.\n3. Speak to your local pharmacist about Over the Counter (OTC) medicines.','Minor burns and scalds','Minor illness suitable for self care','Burns and scalds are damage to the skin caused by heat. Both are treated in the same way. Depending on how serious a burn is, it is possible to treat burns at home. Antiseptic creams and treatments for burns should be included in any products kept in a medicine cabinet at home.','2021-10-12 20:39:28','No','Serious burns always require professional medical attention. Burns requiring hospital emergency treatment include but are not limited to:\n1. Chemical/electrical burns\n2. Large/deep burns (larger than hand-size)\n3. White/charred skin\n4. Burns of face/hands/arms/feet/legs/genitals and cause blisters\n5. DO NOT SEE GP IF BURNS ARE SEVERE - SEE MINOR INJURY UNIT OR GO TO HOSPITAL','26'), ('Ringworm is a common fungal infection that can cause a red or silvery ring-like rash on the skin. Despite its name, ringworm doesn’t have anything to do with worms. \n\nAthlete’s foot is a rash caused by a fungus that usually appears between the toes. ','Yes','1. These fungal infections, medically known as “tinea”, are not serious and are usually easily treated with over the counter treatments.\n2. However, they are contagious and easily spread so it is important to practice good foot hygiene. ','Ringworm/athletes foot','Minor illness suitable for self care','Ringworm is a common fungal infection that can cause a red or silvery ring-like rash on the skin. Despite its name, ringworm doesn\'t have anything to do with worms. Athlete\'s foot is a rash caused by a fungus that usually appears between the toes. These fungal infections, medically known as \"tinea\", are not serious and are usually easily treated with over the counter treatments. However, they are contagious and easily spread so it is important to practice good foot hygiene.','2021-10-12 20:39:28','No','Lymphoedema or history of lower limb cellulitis. ','32'), ('Threadworms (pinworms) are tiny worms that pass in the stools. They are common in children and can be spread easily. They can be effectively treated without the need to visit the GP. ','Yes','Patient Action:\n1. Treatment for threadworms can easily be bought from pharmacies. This is usually a chewable tablet or liquid formulation.\n2. Strict hygiene measures can also help clear up a threadworm infection and reduce the likelihood of reinfection.\n3. Everyone in the household will require treatment, even if they do not have symptoms. \"','Threadworms','Minor illness suitable for self care','Threadworms (pinworms) are tiny worms in your stools. They are common in children and can be spread easily. They can be effectively treated without the need to visit the GP. Treatment for threadworms can easily be bought from pharmacies. This is usually a chewable tablet or liquid you swallow. Strict hygiene measures can also help clear up a threadworm infection and reduce the likelihood of reinfection Everyone in the household will require treatment, even if they don’t have symptoms.','2021-10-12 20:39:28','No','Speak to GP if pregnant or breastfeeding or need to treat a child under the age of 2yrs. ','34')
